autocomplete-suggestion-list .character-match {
  font-weight: normal !important;
}
autocomplete-suggestion-list .right-label {
  max-width: 250px !important;
}
autocomplete-suggestion-list .book .icon {
  color: #87400d !important;
  background: rgba(135, 64, 13, 0.2);
}
autocomplete-suggestion-list .chapter .icon {
  color: #a431c4 !important;
  background: rgba(164, 49, 196, 0.2);
}
autocomplete-suggestion-list .article-journal .icon {
  color: #DF6A73 !important;
  background: rgba(223, 106, 115, 0.2);
}
select-list.reference-search ol.list-group li .primary-line,
select-list.reference-search ol.list-group li .secondary-line {
  text-overflow: ellipsis;
  white-space: nowrap;
  overflow: hidden;
}
select-list.reference-search ol.list-group li div.entry .citekey {
  color: #999;
  font-style: italic;
}
